webpackJsonp([0xd8e97300ffc6],{673:function(n,s){n.exports={data:{site:{siteMetadata:{title:"Dustin Schau - Blog",author:"Dustin Schau"}},markdownRemark:{id:"/Users/okwen/www/gatsbyblog/content/blog/096_2018-09-06/index.md absPath of file >>> MarkdownRemark",html:'<h3 id="css注释"><a href="#css%E6%B3%A8%E9%87%8A" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>CSS注释</h3>\n<ul>\n<li>辅助阅读注释</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token comment">/* logo 样式 */</span>\n<span class="token selector">.logo</span> <span class="token punctuation">{</span>\n <span class="token property">width</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span> <span class="token comment">/* 宽度200px */</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<ul>\n<li>单行代码注释</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token comment">/* logo 样式 */</span>\n<span class="token selector">.logo</span> <span class="token punctuation">{</span>\n <span class="token comment">/* width: 200px; */</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<ul>\n<li>多行代码注释</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token comment">/* logo 样式 */</span>\n<span class="token selector">.logo</span> <span class="token punctuation">{</span>\n    <span class="token property">width</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span>\n    <span class="token comment">/* height: 100px;\n    position: relative;\n    left: 10px;\n    top: 40px; */</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 335px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.55223880597012%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png"\n        srcset="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-3788e.png 163w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-d32ed.png 325w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png 335w"\n        sizes="(max-width: 335px) 100vw, 335px"\n      />\n    </span>\n  </span>\n  </p>',excerpt:"CSS注释 辅助阅读注释 单行代码注释 多行代码注释",timeToRead:1,frontmatter:{date:"2018年09月06日",rawDate:"2018-09-06T13:00:00.000Z",excerpt:"&nbsp",title:"096期 CSS注释",image:{childImageSharp:{resize:{src:"/static/preview-5f723809bab3539ca2b93d3ae17465c7-2c40b.png"}}}}}},pathContext:{prev:{excerpt:"CSS语法 CSS的作用： CSS 指层叠样式表 (Cascading Style Sheets) 样式定义如何显示 HTML 元素 外部样式表可以极大提高工作效率 CSS基本语法  CSS 规则由两个主要的部分构成：选择器，以及一条或多条声明。 在这个例子中，h1 是选择器，color 和 font-size 是属性，red 和 14px…",html:'<h3 id="css语法"><a href="#css%E8%AF%AD%E6%B3%95" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>CSS语法</h3>\n<ul>\n<li>\n<p>CSS的作用：</p>\n<ul>\n<li>CSS 指层叠样式表 (Cascading Style Sheets)</li>\n<li>样式定义如何显示 HTML 元素</li>\n<li>外部样式表可以极大提高工作效率</li>\n</ul>\n</li>\n<li>\n<p>CSS基本语法</p>\n</li>\n</ul>\n<blockquote>\n<p> CSS 规则由两个主要的部分构成：选择器，以及一条或多条声明。</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">h1</span> <span class="token punctuation">{</span><span class="token property">color</span><span class="token punctuation">:</span>red<span class="token punctuation">;</span> <span class="token property">font-size</span><span class="token punctuation">:</span>14px<span class="token punctuation">;</span><span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<blockquote>\n<p>在这个例子中，h1 是选择器，color 和 font-size 是属性，red 和 14px 是值。</p>\n</blockquote>\n<ul>\n<li>记得写引号</li>\n</ul>\n<blockquote>\n<p>如果值为若干单词，则要给值加引号：</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">p</span> <span class="token punctuation">{</span><span class="token property">font-family</span><span class="token punctuation">:</span> <span class="token string">"sans serif"</span><span class="token punctuation">;</span><span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<ul>\n<li>添加空格更直观</li>\n</ul>\n<blockquote>\n<p>大多数样式表包含不止一条规则，而大多数规则包含不止一个声明。多重声明和空格的使用使得样式表更容易被编辑：</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">h1</span> <span class="token punctuation">{</span>\n    <span class="token property">color</span><span class="token punctuation">:</span>red<span class="token punctuation">;</span> \n    <span class="token property">font-size</span><span class="token punctuation">:</span>14px<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 335px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.55223880597012%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png"\n        srcset="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-3788e.png 163w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-d32ed.png 325w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png 335w"\n        sizes="(max-width: 335px) 100vw, 335px"\n      />\n    </span>\n  </span>\n  </p>',id:"/Users/okwen/www/gatsbyblog/content/blog/095_2018-09-06/index.md absPath of file >>> MarkdownRemark",timeToRead:1,fields:{slug:"/videos/95"},frontmatter:{date:"September 06, 2018",draft:!1,title:"095期 CSS语法"}},next:{excerpt:"HTML中引入CSS 行内方式 通过给元素添加 style 属性来添加样式，如下： 它有一个很明显的缺点：只能改变当前标签的样式，如果想要多个元素都使用同一种样式，每个元素都要添加一遍，这样不仅导致HTML代码冗长难以阅读，而且后期维护起来也非常艰难。 所以我们一般不会大量使用这种方式添加样式，只有在少量使用 js 改变样式的时候使用。 内嵌方式 通过在 < head>元素中使用 < style…",html:'<h3 id="html中引入css"><a href="#html%E4%B8%AD%E5%BC%95%E5%85%A5css" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>HTML中引入CSS</h3>\n<ul>\n<li>\n<p>行内方式</p>\n<blockquote>\n<p>通过给元素添加 style 属性来添加样式，如下：</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span><span class="token style-attr language-css"><span class="token attr-name"> <span class="token attr-name">style</span></span><span class="token punctuation">="</span><span class="token attr-value"><span class="token property">color</span><span class="token punctuation">:</span> red<span class="token punctuation">;</span></span><span class="token punctuation">"</span></span><span class="token punctuation">></span></span>颜色为红色<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span><span class="token style-attr language-css"><span class="token attr-name"> <span class="token attr-name">style</span></span><span class="token punctuation">="</span><span class="token attr-value"><span class="token property">color</span><span class="token punctuation">:</span> red<span class="token punctuation">;</span></span><span class="token punctuation">"</span></span><span class="token punctuation">></span></span>颜色为红色<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n</li>\n</ul>\n<blockquote>\n<p>它有一个很明显的缺点：只能改变当前标签的样式，如果想要多个元素都使用同一种样式，每个元素都要添加一遍，这样不仅导致HTML代码冗长难以阅读，而且后期维护起来也非常艰难。<br>\n所以我们一般不会大量使用这种方式添加样式，只有在少量使用 js 改变样式的时候使用。</p>\n</blockquote>\n<ul>\n<li>\n<p>内嵌方式</p>\n<blockquote>\n<p>通过在&#x3C;head>元素中使用&#x3C;style>元素来定义：</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>head</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>text/css<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token style language-css">\n    <span class="token selector">div</span> <span class="token punctuation">{</span>\n        <span class="token property">color</span><span class="token punctuation">:</span> red<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>head</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n</li>\n</ul>\n<blockquote>\n<p>该方法有效解决了第一个行内方式的带来的多元素不能重用同一个样式的问题，但是同时又暴露出了另一个问题：没有办法和其他页面共用，只能本页面使用。所以当多个页面需要引入相同的 CSS 代码时，这样写会导致代码冗余，也不利于维护。<br>\n这种方式我们一般在写简单 demo 的时候或者在移动端追求性能优化时使用。</p>\n</blockquote>\n<ul>\n<li>\n<p>外链方式</p>\n<blockquote>\n<p>通过在&#x3C;head>元素中使用&#x3C;link>元素来引入：</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>head</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>link</span> <span class="token attr-name">rel</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>stylesheet<span class="token punctuation">"</span></span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>text/css<span class="token punctuation">"</span></span> <span class="token attr-name">href</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>style.css<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>head</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n</li>\n</ul>\n<blockquote>\n<p>这是我们网页最常见的也是最推荐的引入 CSS 的方式，具备良好的可维护性。并且如果多个页面共用一个 CSS 文件的话，一般只在第一次加载时需要下载，以后切换页面时根本不需要加载该文件（浏览器一般有缓存）。</p>\n</blockquote>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 335px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.55223880597012%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png"\n        srcset="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-3788e.png 163w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-d32ed.png 325w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png 335w"\n        sizes="(max-width: 335px) 100vw, 335px"\n      />\n    </span>\n  </span>\n  </p>',id:"/Users/okwen/www/gatsbyblog/content/blog/097_2018-09-06/index.md absPath of file >>> MarkdownRemark",timeToRead:1,fields:{slug:"/videos/97"},frontmatter:{date:"September 06, 2018",draft:!1,title:"097期 HTML中引入CSS"}},slug:"/videos/96"}}}});
